import React, { useState } from "react";

const Event = () => {
  let bgcolor = "green";
  const [bg, setBg] = useState(bgcolor);

  const bgchange = () => {
    let set = "red";
    setBg(set);
  };
  return (
    <div style={{ backgroundColor: bg }}>
      <button onClick={bgchange}>Click Me</button>
    </div>
  );
};

export default Event;
